import { Button } from "react-bootstrap";
import { useDispatch, useSelector } from "react-redux";

const OneKey = ({keyitem}, key) => {
    const dispatch = useDispatch()
    return (
        keyitem.employeeid == null ?
        <tr key={key}>
            <td>{keyitem.keyid}</td>
            <td>{keyitem.cabinet}</td>
            <td><Button variant="secondary" disabled>Свободен</Button></td>
            <td><Button variant="danger">Удалить ключ</Button></td>
        </tr>
        :
        <tr key={key}>
            <td>{keyitem.keyid}</td>
            <td>{keyitem.cabinet}</td>
            <td><Button variant="warning">Взят</Button></td>
            <td><Button variant="danger">Удалить ключ</Button></td>
        </tr>
    );
};

export default OneKey;
